import { React, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
const Admin = () => {
    const navigate = useNavigate()
    const [users, setUsers] = useState([])
    useEffect(() => {
        fetch('/admin', {
            method: "get",
            headers: {
                "Content-Type": "application/json",
            },

        })
            .then((res) => res.json())
            .then((res) => {
                console.log(res)
                setUsers(res)

            });
    }, [])
    return (
        <div style={{ width: '100%', height: '100%', display: 'flex', justifyContent: "center", marginTop: "12%" }}>
            <div class="styled-table">
                <table >
                    <thead>
                        <tr>
                            <th>Id</th>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Department</th>
                            <th>Status</th>
                            <th colSpan={3}>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {users.map(user => {
                            return (
                                <tr>
                                    <td>{user.id}</td>
                                    <td>{user.name}</td>
                                    <td>{user.email}</td>
                                    <td>{user.department}</td>
                                    <td>{user.status}</td>
                                    <td><a href="">View</a></td>
                                    <td><a href="">Edit</a></td>
                                    <td><a href=""></a></td>
                                </tr>
                            )
                        })}


                    </tbody>
                </table>
            </div>
        </div>
    )
}

export default Admin
